/// next : 2
/// previous : null

class Links {
  Links({
    num? next,
    dynamic previous,
  }) {
    _next = next;
    _previous = previous;
  }

  Links.fromJson(dynamic json) {
    _next = json['next'];
    _previous = json['previous'];
  }
  num? _next;
  dynamic _previous;
  Links copyWith({
    num? next,
    dynamic previous,
  }) =>
      Links(
        next: next ?? _next,
        previous: previous ?? _previous,
      );
  num? get next => _next;
  dynamic get previous => _previous;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['next'] = _next;
    map['previous'] = _previous;
    return map;
  }
}
